import { NavLink } from 'react-router-dom';
import navbarCSS from './Navbar.module.css';


const Navbar = () => {
  return <nav className={navbarCSS.nav}>
  <div><NavLink to='/profile'>Profile</NavLink></div>
  <div className={navbarCSS.item}><NavLink to='/dialogs'>Messages</NavLink></div>
  <div className={navbarCSS.item}><NavLink to='/news'>News</NavLink></div>
  <div className={navbarCSS.item}><NavLink to='/music'>Music</NavLink></div><br></br>
  <div className={navbarCSS.item}><NavLink to='/settings'>Settings</NavLink></div>
</nav>
}


export default Navbar;
